window.bookSummaryJSON = "<p><b>\"The training levels have concluded. Now the games may truly begin.\"</b></p> <p>The ratings and views are off the chart. The fans just can't get enough. The dungeon gets more dangerous each day. But in a grinder designed to chew up and spit out crawlers by the millions, Carl and Princess Donut need to work harder than ever just to survive.&nbsp;</p> <p>They call it the Over City. A sprawling, once-thriving metropolis devastated by a mysterious calamity. But these streets are far from abandoned. An undead circus trawls the ruins. Murdered prostitutes rain from the sky. An ancient spell is finally ready to reveal its dark purpose.&nbsp;</p> <p>Carl still has no pants.&nbsp;&nbsp;<br> <br> They call it&nbsp;<i>Dungeon Crawler World</i>. For Carl and Donut, it's anything but a game.&nbsp;</p>"; 
